{
    var messageBus = new Mock<IMessageBus>();
    messageBus.Setup(s => s.QueueMessage(It.IsAny<IMessageSinkMessage>())).Returns(true);
    var messageSink = new Mock<IMessageSink>();
    var sut = GetFailTestCase(1, messageSink.Object);
    var runner = new TestableTestCaseRunner<FlakyTestCase>(sut, messageSink.Object, messageBus.Object, new ExceptionAggregator(), new CancellationTokenSource());
    sut.FlakyDisposition.Should().Be(FlakyDisposition.NotStarted);
    await runner.RunAsync();
    sut.FlakyDisposition.Should().Be(FlakyDisposition.Fail);
}

